import { Box } from "@mui/material";
import { themes } from "../../../config/icons";

const body = () =>{

    const themeMode = themes.light

    return (
        <Box
            display="flex"
            padding="0px 8px"
            justifyContent="center"      
        >
            <Box padding="0px 8px" alignItems="center">
                <Box component={"img"} src={themeMode.imagen.imgnovia} marginBottom="12px"/>
                <Box component={"img"} src={themeMode.imagen.imgrisco}/>
            </Box>
            <Box padding="0px 8px" a="center">
                <Box component={"img"} src={themeMode.imagen.imgnadando}/>
            </Box>
        </Box>
    );
}

export default body;
